import React from 'react';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper } from '@mui/material';
import './DataTable.css';

const styles = {
    tableHeader: {
        position: 'sticky',
        top: 0,
        backgroundColor: '#fff',
        zIndex: 2
    },
    summaryRow: {
        backgroundColor: 'yellow',
        fontWeight: 'bold',
        position: 'sticky',
        top: 50,
        zIndex: 1
    },
    imageCell: {
        position: 'relative',
    },
    image: {
        width: 50,
        height: 50,
        transition: 'transform 0.2s',
    },
    imageHover: {
        position: 'absolute',
        width: 150,
        height: 150,
        zIndex: 10,
        transform: 'scale(3)',
        transition: 'transform 0.2s',
    }
};

class DataTable extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            hoverIndex: null,
        };
    }

    handleMouseEnter = (index) => {
        this.setState({ hoverIndex: index });
    }

    handleMouseLeave = () => {
        this.setState({ hoverIndex: null });
    }

    render() {
        const { data } = this.props;
        const { hoverIndex } = this.state;

        if (!data.length) {
            console.log('No data to display');
            return null;
        }

        console.log('Displaying data:', data);

        return (
            <TableContainer component={Paper}>
                <Table>
                    <TableHead>
                        <TableRow style={styles.tableHeader}>
                            <TableCell>Image</TableCell>
                            <TableCell>ASIN</TableCell>
                            <TableCell>Title</TableCell>
                            <TableCell>Brand</TableCell>
                            <TableCell>Price</TableCell>
                            <TableCell>Reviews</TableCell>
                            <TableCell>Rating</TableCell>
                            <TableCell>Sales</TableCell>
                            <TableCell>% of Total Sales</TableCell>
                            <TableCell>Revenue</TableCell>
                            <TableCell>% of Total Revenue</TableCell>
                            <TableCell>Seller Type</TableCell>
                            <TableCell>Date First Available</TableCell>
                            <TableCell>Category</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {data.map((row, index) => (
                            <TableRow key={index} style={row.asin === "Summary" ? styles.summaryRow : {}}>
                                <TableCell style={styles.imageCell}>
                                    {row.imageUrl && (
                                        <img
                                            src={row.imageUrl}
                                            alt={row.title}
                                            style={hoverIndex === index ? { ...styles.image, ...styles.imageHover } : styles.image}
                                            onMouseEnter={() => this.handleMouseEnter(index)}
                                            onMouseLeave={this.handleMouseLeave}
                                        />
                                    )}
                                </TableCell>
                                <TableCell className="table-cell">{row.asin}</TableCell>
                                <TableCell className="table-cell">{row.title}</TableCell>
                                <TableCell className="table-cell">{row.brand}</TableCell>
                                <TableCell className="table-cell">{`$${parseFloat(row.price).toLocaleString()}`}</TableCell>
                                <TableCell className="table-cell">{row.reviews}</TableCell>
                                <TableCell className="table-cell">{row.rating}</TableCell>
                                <TableCell className="table-cell">{row.sales}</TableCell>
                                <TableCell className="table-cell">{row.percentOfTotalSales}</TableCell>
                                <TableCell className="table-cell">{`$${parseFloat(row.revenue).toLocaleString()}`}</TableCell>
                                <TableCell className="table-cell">{row.percentOfTotalRevenue}</TableCell>
                                <TableCell className="table-cell">{row.sellerType}</TableCell>
                                <TableCell className="table-cell">{row.dateFirstAvailable}</TableCell>
                                <TableCell className="table-cell">{row.category}</TableCell>
                            </TableRow>
                        ))}
                    </TableBody>
                </Table>
            </TableContainer>
        );
    }
}

export default DataTable;
